import React from 'react';
import Nav from './Nav';

function Timer() {

  return (
    <>
      <Nav></Nav>
      <article className='contents'>
        <section>
          <h1>TIMER</h1>
          <div>
            <input type="radio" id="radioTimer" name="radio" value="Timer"></input>
            <label for="radioTimer">Timer</label>
            <input type="radio" id="radioStopwatch" name="radio" value="StopWatch"></input>
            <label for="radioStopwatch">StopWatch</label>
          </div>
        </section>

        <div>

        </div>
      </article>
    </>
  )
}

export default Timer;
